        <div className="row">
          <div className="col-4">
          <a href={link+'_1'} className="MagicZoom abc24" id="trainer"  data-options="zoomPosition: inner"><img src={link+'_to1'}></img></a>
          </div>
          <div className="col-8"></div>
        </div>
    </div>
  );
}}

export default About;
